  false,\n\t\"url\": null,\n\t\"notes\": \"The Central Andes gravity data (6,151 records)
  were compiled by Professor Gotze and the MIGRA Group. This data base was received
  in April, 1997. Principal gravity parameters include Free-air Anomalies and Bouguer
  Anomalies (terrain and mass corrected). The gravity station data have been adjusted
  to the International Gravity Standardization Net 1971 (IGSN 71). The gravity anomaly
  computation uses the Geodetic Reference System 1967 (GRS 67) theoretical gravity
  formula. The data are randomly distributed within the area bounded by 64 - 71 degrees
  West and 20 - 29 degrees South in the Central Andes of South America.\",\n\t\"license_title\":
  null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\": \"[{\"name\":
